INSERT INTO `editor_contents` (`id`, `name_page`, `content`, `created_at`, `updated_at`) VALUES
(37, 'aboutus', '<br/><section class=\"py-5\"><div class=\"container\"><h2 id=\"i491g\" class=\"text-center mb-4\">Storia e Missioni</h2><div class=\"row\"><!-- Colonna Storia --><div class=\"col-md-6\"><p class=\"text-primary\">AssoLabFondi nasce con l’obiettivo di rivoluzionare il settore previdenziale in Italia, offrendo \n                    supporto operativo e formazione su strumenti finanziari innovativi. L\'associazione si pone come \n                    una realtà indipendente e completamente priva di influenze politiche o sindacali. La visione di \n                    AssoLabFondi è quella di essere un punto di riferimento per i cambiamenti e l’innovazione, creando \n                    opportunità di diversificare i propri portafogli con soluzioni innovative.\n                </p></div><!-- Colonna Perché scegliere noi --><div class=\"col-md-6\"><h5 class=\"text-primary fw-bold\">PERCHÉ SCEGLIERE NOI?</h5><ol class=\"text-primary\"><li>Operiamo con un approccio pratico e senza influenze politiche o sindacali.</li><li>Promuoviamo l’adozione di strumenti innovativi come private equity, infrastrutture e polizze catastrofali.</li><li>Ci impegniamo a fornire formazione e confronto diretto per creare valore reale nel settore previdenziale.</li></ol></div></div></div></section><section class=\"py-5\"><div class=\"container\"><div class=\"row align-items-center\"><!-- Immagine principale --><div class=\"col-md-4 text-center\"><div id=\"i9pux\"><img src=\"data:image/jpeg;base64,\" alt=\"Immagine di Sergio Carfizzi\" id=\"i0m83\"/></div></div><!-- Testo principale --><div class=\"col-md-8\"><h2 id=\"imqnk\" class=\"fw-bold\">Sergio Carfizzi</h2><p class=\"text-primary\">\n                    Sergio Carfizzi è un esperto di finanza internazionale con una carriera di oltre 20 anni nel settore \n                    della previdenza complementare. Ha ricoperto ruoli di spicco come Direttore Generale presso \n                    importanti fondi pensione e ha dedicato la sua vita a promuovere innovazione e inclusività, puntando \n                    sull\'importanza del capitale umano, sia junior che senior. Il suo obiettivo è sempre stato quello \n                    di coniugare etica e performance, esplorando nuovi orizzonti di investimento come private equity, \n                    infrastrutture e polizze catastrofali.\n                </p></div></div></div></section><style>* { box-sizing: border-box; } body {margin: 0;}*{box-sizing:border-box;}body{margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px;}#i491g{color:rgb(240, 126, 70);}#i9pux{width:200px;height:200px;border-top-left-radius:50%;border-top-right-radius:50%;border-bottom-right-radius:50%;border-bottom-left-radius:50%;overflow-x:hidden;overflow-y:hidden;background-color:rgb(241, 241, 241);}#i0m83{width:100%;height:100%;object-fit:cover;}#imqnk{color:rgb(240, 126, 70);}</style>', '2024-10-18 13:44:27', '2024-11-29 21:37:53');
INSERT INTO `editor_contents` (`id`, `name_page`, `content`, `created_at`, `updated_at`) VALUES
(41, 'home', '<section id=\"imew8\" class=\"position-relative text-center text-white\"><div id=\"izxij\" class=\"position-absolute top-50 start-50 translate-middle\"><h1 class=\"display-4 fw-bold text-primary\"><br/><br/>Vicini agli iscritti della previdenza</h1><p class=\"fs-5 text-primary mt-3\">Assolabfondi è un laboratorio di idee, di formazione e di confronto dove gli investitori istituzionali della previdenza hanno la possibilità  di arricchire le proprie conoscenze per investimenti sempre più diversificati e consapevoli nel primario interesse dei propri iscritti</p><div class=\"mt-4\"><a href=\"#ib0k3\" id=\"iwevg\" class=\"btn text-white btn-lg me-3\">Scopri di più</a><a href=\"Login\" id=\"ixof5\" class=\"btn text-white btn-lg\">Area personale</a></div></div></section><section class=\"py-5 bg-light\"><div class=\"container\"><!-- Titolo --><div class=\"text-center mb-4\"><h2 class=\"fw-bold text-primary\">Chi è Sergio Carfizzi e Assolabfondi</h2><p id=\"ipvq2\" class=\"mx-auto text-primary\">Sergio Carfizzi è stato Direttore Generale di due importanti fondi pensione italiani: Banco di Napoli dal 2001 al 2007 e Banche di Credito Cooperativo dal 2008 al 2022. Attualmente Fondatore di Assolabfondi</p></div><!-- Paragrafi superiori --><div class=\"row text-center mb-5\"><div class=\"col-md-6\"><p id=\"iu9db\" class=\"text-primary\"><b>Sergio Carfizzi</b>, con una carriera bancaria ai massimi livelli tra Napoli, Milano, Londra e New York, è esperto di finanza internazionale, includendo private equity, real estate e cartolarizzazioni. Professore di economia, ha vinto premi internazionali ed è oggi consulente indipendente in ambito ESG.<br/></p></div><div class=\"col-md-6\"><p id=\"iqfew\" class=\"text-primary\"><b>AssoLabFondi</b> è un’associazione operativa dedicata a promuovere innovazione, formazione e supporto pratico nel settore della finanza. <br/>La sua missione è quella di creare uno spazio collaborativo e privo di influenze politiche o sindacali, dove gli operatori del settore possano confrontarsi e adottare soluzioni innovative.<br/></p></div></div><!-- Timeline --><div class=\"position-relative\"><div class=\"row text-center position-relative\"><!-- Primo elemento --><div class=\"col-md-3 mb-4\"><div class=\"timeline-item d-inline-block position-relative\"><div id=\"iyvgr\" class=\"timeline-icon text-white rounded-circle mb-2\"><i class=\"fas fa-dollar-sign\"></i></div><p class=\"fw-bold text-primary mb-0\">Banco di Napoli</p><p class=\"text-muted small\">Avvio della carriera professionale</p><p class=\"fw-bold\">Anno 1976-1983</p></div></div><!-- Secondo elemento --><div class=\"col-md-3 mb-4\"><div class=\"timeline-item d-inline-block position-relative\"><div id=\"iu2f5\" class=\"timeline-icon text-white rounded-circle mb-2\"><i class=\"fas fa-map-marker-alt\"></i></div><p class=\"fw-bold text-primary mb-0\">Credito Cooperativo</p><p class=\"text-muted small\">Sviluppa progetti innovativi nel settore, <br/><br/>rivoluzionando scenari e approcci tradizionali</p><p class=\"fw-bold\">Anno 2008</p></div></div><!-- Terzo elemento --><div class=\"col-md-3 mb-4\"><div class=\"timeline-item d-inline-block position-relative\"><div id=\"i3kng\" class=\"timeline-icon text-white rounded-circle mb-2\"><i class=\"fas fa-comments\"></i></div><p class=\"fw-bold text-primary mb-0\">investimenti alternativi</p><p class=\"text-muted small\">•	Focus su private equity, private debt, e strumenti decorrelati. •	Più del 50% degli investimenti alternativi gestiti con un’impronta “Made in Italy”.</p><p class=\"fw-bold\">Anno dal 2010 circa</p></div></div><!-- Quarto elemento --><div class=\"col-md-3 mb-4\"><div class=\"timeline-item d-inline-block position-relative\"><div id=\"i12v1\" class=\"timeline-icon text-white rounded-circle mb-2\"><i class=\"fas fa-archive\"></i></div><p class=\"fw-bold text-primary mb-0\">Riconoscimenti e premi internazionali</p><p class=\"text-muted small\">•	World Pension Summit (2018). •	IPE Conference &amp; Awards (2018, 2021).</p><p class=\"fw-bold\">Anno dal 2018</p></div></div></div></div></div></section><section class=\"py-5\"><div class=\"container\"><!-- Titolo --><div class=\"text-center mb-5\"><h2 class=\"fw-bold\">Missioni e Valori</h2></div><!-- Cards --><div class=\"row g-4\"><!-- Card 1 --><div class=\"col-md-4\"><div id=\"ikaa46\" class=\"card border-0 shadow-sm text-center py-4\"><div class=\"card-body\"><div class=\"mb-3\"><img src=\"data:image/png;base64,\" alt=\"Icon 1\" id=\"i5pr1v\"/></div><h5 class=\"fw-bold text-primary\">Indipendenza e neutralità</h5><p class=\"text-muted\">Operare senza influenze politiche o sindacali, mantenendo una visione esclusivamente pratica e operativa per supportare i membri in maniera imparziale.\n                        </p></div></div></div><!-- Card 2 --><div class=\"col-md-4\"><div id=\"icnez9\" class=\"card border-0 shadow-sm text-center py-4\"><div class=\"card-body\"><div class=\"mb-3\"><img src=\"data:image/png;base64,\" alt=\"Icon 2\" id=\"in9ni7\"/></div><h5 class=\"fw-bold text-primary\">Innovazione e formazione continua</h5><p class=\"text-muted\">Valorizzare l’adozione di strumenti finanziari avanzati e promuovere l’educazione finanziaria, rendendo i membri più consapevoli delle opportunità di mercato.\n                        </p></div></div></div><!-- Card 3 --><div class=\"col-md-4\"><div id=\"iv8j4s\" class=\"card border-0 shadow-sm text-center py-4\"><div class=\"card-body\"><div class=\"mb-3\"><img src=\"data:image/png;base64,\" alt=\"Icon 3\" id=\"i9yudl\"/></div><h5 class=\"fw-bold text-primary\">Inclusività e collaborazione</h5><p class=\"text-muted\">Favorire il dialogo e la cooperazione tra professionisti, casse e aziende per creare sinergie che migliorino il sistema previdenziale italiano e la diversificazione degli investimenti.\n                        </p></div></div></div></div></div></section><section class=\"py-5 bg-light\"><div class=\"container text-center\"><!-- Titolo --><div class=\"mb-4\"><h2 class=\"fw-bold text-primary\">Fondi e Casse Previdenziali</h2></div><!-- Contenuto --><div class=\"row g-4\"><!-- Partner 1 --><div class=\"col-md-3\"><div class=\"d-flex flex-column align-items-center\"><div class=\"d-flex align-items-center\"><span id=\"imzwxj\" class=\"me-2\">•</span><h5 class=\"fw-bold text-primary mb-0\">Banco di Napoli</h5></div><p class=\"text-muted mt-2\">Ha avviato la sua carriera professionale, ricoprendo ruoli di rilievo e contribuendo attivamente alla strategia aziendale del gruppo bancario. La sua influenza si è estesa anche alla gestione operativa e finanziaria.\n                    </p></div></div><!-- Partner 2 --><div class=\"col-md-3\"><div class=\"d-flex flex-column align-items-center\"><div class=\"d-flex align-items-center\"><span id=\"iomxkv\" class=\"me-2\">•</span><h5 class=\"fw-bold text-primary mb-0\">BCC</h5></div><p class=\"text-muted mt-2\">Dal 2008, ha avuto un ruolo cruciale nella gestione e nella strategia del sistema bancario cooperativo. Ha introdotto modelli di investimento alternativi e innovativi, trasformando scenari tradizionali in opportunità concrete per gli investitori.\n                    </p></div></div><!-- Partner 3 --><div class=\"col-md-3\"><div class=\"d-flex flex-column align-items-center\"><div class=\"d-flex align-items-center\"><span id=\"immsfi\" class=\"me-2\">•</span><h5 class=\"fw-bold text-primary mb-0\">Fondo Pensione Banco di Napoli</h5></div><p class=\"text-muted mt-2\">Ha operato come direttore generale, contribuendo alla crescita e alla gestione del fondo. La sua leadership si è concentrata sullo sviluppo di strategie innovative e investimenti decorrelati, consolidando la posizione del fondo sul mercato.\n                    </p></div></div><!-- Partner 4 --><div class=\"col-md-3\"><div class=\"d-flex flex-column align-items-center\"><div class=\"d-flex align-items-center\"><span id=\"iooh1b\" class=\"me-2\">•</span><h5 class=\"fw-bold text-primary mb-0\">Fondo Pensione delle Banche di Credito Cooperativo</h5></div><p class=\"text-muted mt-2\">Ha ricoperto la posizione di General Manager, con un’influenza determinante sulla gestione degli investimenti e sulle scelte strategiche del fondo. Ha promosso strumenti finanziari innovativi e sostenibili, con un focus sugli ESG.\n                    </p></div></div></div><!-- Bottone --><div class=\"mt-4\"><a href=\"Login\" class=\"btn btn-primary btn-lg\">Area Utente</a></div></div></section><section class=\"py-5 bg-light\"><div class=\"container\"><!-- Titolo --><div class=\"text-center mb-5\"><h2 class=\"fw-bold\">Eventi e Seminari</h2><p class=\"text-primary fs-5\">Eventi imminenti</p></div><!-- Cards --><div id=\"eventi-container\" class=\"row g-4\"><!-- Eventi caricati dinamicamente --></div><!-- Bottone --><div class=\"text-center mt-4\"><a href=\"#\" class=\"btn btn-primary btn-lg\" id=\"ilrkwf\">Scopri di più</a></div></div></section><section id=\"ib0k3\" class=\"py-5\"><div class=\"container text-center\"><h2 class=\"text-orange mb-4\">Assolabfondi a tua disposizione</h2><div id=\"iaki1\" class=\"card mx-auto shadow-sm\"><h4 class=\"text-orange mb-3\"><span id=\"iu93g\">Per saperne di più</span></h4><div class=\"chat-container\"><div id=\"chat-messages\" class=\"chat-messages\"><!-- I messaggi verranno caricati qui dinamicamente --></div><form id=\"chat-form\"><input type=\"text\" id=\"user-message\" placeholder=\"Scrivi un messaggio...\" required/><button type=\"submit\" id=\"ihabe\" class=\"btn\">Invia</button></form></div></div></div></section><style>* { box-sizing: border-box; } body {margin: 0;}*{box-sizing:border-box;}body{margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px;}#ib0k3{background-color:rgb(248, 248, 248);}#iaki1{max-width:400px;border-top-left-radius:15px;border-top-right-radius:15px;border-bottom-right-radius:15px;border-bottom-left-radius:15px;padding-top:20px;padding-right:20px;padding-bottom:20px;padding-left:20px;}#chat-messages{height:300px;overflow-y:auto;border-top-width:1px;border-top-style:solid;border-top-color:rgb(204, 204, 204);border-right-width:1px;border-right-style:solid;border-right-color:rgb(204, 204, 204);border-bottom-width:1px;border-bottom-style:solid;border-bottom-color:rgb(204, 204, 204);border-left-width:1px;border-left-style:solid;border-left-color:rgb(204, 204, 204);border-image-outset:0;border-image-repeat:stretch;border-image-slice:100%;border-image-source:none;border-image-width:1;padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;}#chat-form{margin-top:10px;}#user-message{width:80%;padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;}#ihabe{padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;}.text-orange.mb-3{color:rgb(240, 128, 70);}.text-orange.mb-4{color:rgb(240, 128, 70);}.btn.btn-lg.me-3{background-color:rgb(240, 128, 70);}.btn.bg-dark.btn-lg{background-color:rgb(240, 128, 70);}.btn.btn-lg{background-color:rgb(240, 128, 70);color:white;}#imew8{background-color:rgba(0, 0, 0, 0);background-position-x:50%;background-position-y:50%;background-repeat:no-repeat;background-attachment:scroll;background-image:url(\"admin/materials/senior-couple-communicating-with-insurance-agent-while-having-consultations-with-him-office-focus-is-woman.png\");background-size:cover;background-origin:padding-box;background-clip:border-box;height:100vh;}#izxij{max-width:800px;}#iwevg{background-color:rgb(240, 128, 70);background-position-x:0%;background-position-y:0%;background-repeat:repeat;background-attachment:scroll;background-image:none;background-size:auto;background-origin:padding-box;background-clip:border-box;}#ixof5{background-color:rgb(240, 128, 70);background-position-x:0%;background-position-y:0%;background-repeat:repeat;background-attachment:scroll;background-image:none;background-size:auto;background-origin:padding-box;background-clip:border-box;}#ipvq2{max-width:800px;}#iyvgr{width:50px;height:50px;line-height:50px;}#iu2f5{width:50px;height:50px;line-height:50px;}#i3kng{width:50px;height:50px;line-height:50px;}#i12v1{width:50px;height:50px;line-height:50px;}.timeline-icon.text-white.rounded-circle.mb-2{background-color:rgb(240, 128, 70);}#ikaa46{border-top-left-radius:15px;border-top-right-radius:15px;border-bottom-right-radius:15px;border-bottom-left-radius:15px;}#i5pr1v{width:79px;height:84px;}#icnez9{border-top-left-radius:15px;border-top-right-radius:15px;border-bottom-right-radius:15px;border-bottom-left-radius:15px;}#in9ni7{width:87px;height:81px;}#iv8j4s{border-top-left-radius:15px;border-top-right-radius:15px;border-bottom-right-radius:15px;border-bottom-left-radius:15px;}#i9yudl{width:79px;height:85px;}.fw-bold{color:rgb(240, 128, 70);}#imzwxj{color:rgb(0, 123, 255);font-size:1.2rem;}#iomxkv{color:rgb(0, 123, 255);font-size:1.2rem;}#immsfi{color:rgb(0, 123, 255);font-size:1.2rem;}#iooh1b{color:rgb(0, 123, 255);font-size:1.2rem;}.btn{background-color:rgb(240, 128, 70);}.py-5.bg-light{color:rgb(255, 255, 255);}</style>', '2024-11-20 23:44:11', '2024-11-29 22:59:32');
