(45, 'Registrati', '<section class=\"d-flex justify-content-center align-items-center vh-100 bg-light\"><div class=\"card p-4 shadow-sm\" id=\"ir8g\"><h2 class=\"text-center text-primary mb-4\">Sign-In</h2><!-- Form che invia i dati a register.php --><form action=\"register.php\" method=\"POST\"><div class=\"mb-3\"><label for=\"nome\" class=\"form-label\">Nome</label><input type=\"text\" id=\"nome\" name=\"nome\" required class=\"form-control\"/></div><div class=\"mb-3\"><label for=\"cognome\" class=\"form-label\">Cognome</label><input type=\"text\" id=\"cognome\" name=\"cognome\" required class=\"form-control\"/></div><div class=\"mb-3\"><label for=\"email\" class=\"form-label\">Email</label><input type=\"email\" id=\"email\" name=\"email\" required class=\"form-control\"/></div><div class=\"mb-3\"><label for=\"telefono\" class=\"form-label\">Telefono</label><input type=\"text\" id=\"telefono\" name=\"telefono\" required class=\"form-control\"/></div><div class=\"mb-3\"><label for=\"password\" class=\"form-label\">Password</label><input type=\"password\" id=\"password\" name=\"password\" required class=\"form-control\"/></div><button type=\"submit\" class=\"btn btn-primary\">Registrati</button></form><p class=\"text-center mt-3\">Hai già un account? <a href=\"Login\" class=\"text-primary\">Accedi</a></p></div></section><style>* { box-sizing: border-box; } body {margin: 0;}*{box-sizing:border-box;}body{margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px;}#ir8g{max-width:400px;width:100%;}</style>', '2024-11-21 00:00:30', '2024-11-26 01:03:56'),
(47, 'Login', '<section class=\"d-flex justify-content-center align-items-center vh-100 bg-light\"><div class=\"card p-4 shadow-sm\" id=\"ic2a\"><h2 class=\"text-center text-primary mb-4\">Login</h2><form action=\"login.php\" method=\"POST\"><div class=\"mb-3\"><label for=\"email\" class=\"form-label\">Email</label><input type=\"email\" id=\"email\" name=\"email\" required class=\"form-control\"/></div><div class=\"mb-3\"><label for=\"password\" class=\"form-label\">Password</label><input type=\"password\" id=\"password\" name=\"password\" required class=\"form-control\"/></div><button type=\"submit\" class=\"btn btn-primary\">Accedi</button></form><p class=\"text-center mt-3\">Non hai un account? <a href=\"Registrati\" class=\"text-primary\">Registrati</a></p></div></section><style>* { box-sizing: border-box; } body {margin: 0;}*{box-sizing:border-box;}body{margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px;}#ic2a{max-width:400px;width:100%;}</style>', '2024-11-25 23:57:13', '2024-11-26 01:03:26'),
