INSERT INTO `editor_contents` (`id`, `name_page`, `content`, `created_at`, `updated_at`) VALUES
(69, 'privacy-e-policy', '<br/><br/><br/><header class=\"bg-primary text-white text-center py-4\"><h1>Privacy Policy</h1><p class=\"mb-0\">AssoLabFondi si impegna a proteggere i tuoi dati personali</p></header><!-- Main Content --><main class=\"container my-5\"><section class=\"mb-5\"><h2 class=\"text-primary\">1. Introduzione</h2><p>Benvenuto su AssoLabFondi. La tua privacy è importante per noi e ci impegniamo a proteggere i tuoi dati personali in conformità con il GDPR e altre leggi applicabili.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">2. Chi Siamo</h2><p>AssoLabFondi è un’associazione dedicata a fornire supporto operativo a fondi pensione, casse di previdenza e fondi sanitari. Per domande sulla privacy, contattaci a: <a href=\"mailto:privacy@assolabfondi.it\">privacy@assolabfondi.it</a>.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">3. Quali Dati Raccogliamo</h2><ul><li><strong>Dati forniti dagli utenti:</strong> Nome, cognome, email, numero di telefono, dati di login.</li><li><strong>Dati relativi all’utilizzo:</strong> Indirizzo IP, browser utilizzato, cronologia di navigazione.</li><li><strong>Dati aggiuntivi:</strong> Informazioni relative agli eventi e ai seminari a cui partecipi.</li></ul></section><section class=\"mb-5\"><h2 class=\"text-primary\">4. Come Utilizziamo i Dati</h2><p>Utilizziamo i tuoi dati per:</p><ul><li>Fornire accesso ai nostri servizi e contenuti.</li><li>Personalizzare la tua esperienza sulla piattaforma.</li><li>Comunicare con te in relazione agli eventi e ai servizi.</li><li>Adempiere a obblighi legali.</li></ul></section><section class=\"mb-5\"><h2 class=\"text-primary\">5. Condivisione dei Dati</h2><p>Non condividiamo i tuoi dati personali con terze parti, salvo nei seguenti casi:</p><ul><li>Fornitori di servizi che agiscono per nostro conto.</li><li>Obblighi legali o richieste delle autorità competenti.</li><li>Consenso esplicito da parte tua.</li></ul></section><section class=\"mb-5\"><h2 class=\"text-primary\">6. Protezione dei Dati</h2><p>Adottiamo misure di sicurezza tecniche e organizzative per proteggere i tuoi dati personali da accessi non autorizzati, perdite o divulgazioni.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">7. I Tuoi Diritti</h2><p>Hai diritto a:</p><ul><li>Accedere ai tuoi dati personali.</li><li>Richiedere la modifica o cancellazione dei dati.</li><li>Revocare il consenso in qualsiasi momento.</li><li>Presentare un reclamo presso l\'autorità di protezione dei dati.</li></ul><p>Per esercitare i tuoi diritti, contattaci a: <a href=\"mailto:privacy@assolabfondi.it\">privacy@assolabfondi.it</a>.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">8. Cookie e Tecnologie Simili</h2><p>Utilizziamo cookie per migliorare la tua esperienza. Puoi gestire le tue preferenze sui cookie tramite le impostazioni del browser.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">9. Termini di Utilizzo</h2><p>Accedendo alla piattaforma AssoLabFondi, accetti i nostri termini di utilizzo:</p><ul><li>Non caricare contenuti illeciti o offensivi.</li><li>Non compromettere la sicurezza della piattaforma.</li></ul></section></main><style>* { box-sizing: border-box; } body {margin: 0;}*{box-sizing:border-box;}body{margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px;}</style>', '2024-11-29 22:35:39', '2024-11-29 22:52:54'),
(73, 'cookie-e-policy', '<br/><br/><br/><header class=\"text-white text-center py-4\"><h1>Cookie Policy</h1><p class=\"mb-0\">Come utilizziamo i cookie sulla piattaforma AssoLabFondi</p></header><!-- Main Content --><main class=\"container my-5\"><section class=\"mb-5\"><h2 id=\"ih4ch\">1. Cosa Sono i Cookie?</h2><p>I cookie sono piccoli file di testo che vengono salvati sul tuo dispositivo quando visiti un sito web. Servono a migliorare la tua esperienza utente, ricordando le tue preferenze o raccogliendo informazioni anonime sul tuo utilizzo del sito.</p></section><section class=\"mb-5\"><h2 id=\"isyy6\">2. Tipi di Cookie Utilizzati</h2><ul><li><strong>Cookie Necessari:</strong> Essenziali per il funzionamento della piattaforma, ad esempio per il login e la navigazione sicura.</li><li><strong>Cookie di Prestazione:</strong> Raccolgono dati anonimi sull’utilizzo del sito per migliorarne le funzionalità.</li><li><strong>Cookie Funzionali:</strong> Ricordano le tue preferenze, come la lingua o la regione.</li><li><strong>Cookie di Marketing:</strong> Utilizzati per mostrarti contenuti e pubblicità personalizzati.</li></ul></section><section class=\"mb-5\"><h2 id=\"irxri\">3. Come Utilizziamo i Cookie?</h2><p>Su AssoLabFondi utilizziamo i cookie per:</p><ul><li>Garantire il corretto funzionamento della piattaforma.</li><li>Analizzare il traffico e migliorare l’esperienza utente.</li><li>Mostrare contenuti pertinenti agli utenti registrati.</li></ul></section><section class=\"mb-5\"><h2 id=\"ixf6d\">4. Gestione dei Cookie</h2><p>Puoi gestire o eliminare i cookie in qualsiasi momento tramite le impostazioni del tuo browser. Disabilitare alcuni cookie potrebbe influire sull’esperienza di navigazione. Ecco alcune guide per i browser principali:</p><ul><li><a href=\"https://support.google.com/chrome/answer/95647\" target=\"_blank\">Google Chrome</a></li><li><a href=\"https://support.mozilla.org/it/kb/attivare-disattivare-cookie\" target=\"_blank\">Mozilla Firefox</a></li><li><a href=\"https://support.microsoft.com/it-it/microsoft-edge\" target=\"_blank\">Microsoft Edge</a></li><li><a href=\"https://support.apple.com/it-it/guide/safari/sfri11471/mac\" target=\"_blank\">Apple Safari</a></li></ul></section><section class=\"mb-5\"><h2 id=\"iw4cm\">5. Cookie di Terze Parti</h2><p>Potremmo utilizzare cookie di terze parti, ad esempio per analisi di traffico o per integrare funzionalità come video e social media. Questi cookie sono soggetti alle policy delle rispettive terze parti.</p></section><section class=\"mb-5\"><h2 id=\"i5gea\">6. Aggiornamenti alla Cookie Policy</h2><p>Questa policy potrebbe essere aggiornata per riflettere cambiamenti nelle leggi o nei nostri servizi. Ti invitiamo a controllare questa pagina periodicamente.</p></section><section class=\"mb-5\"><h2 id=\"i7x0w\">7. Contatti</h2><p>Per qualsiasi domanda sulla nostra Cookie Policy, puoi contattarci via email a: <a href=\"mailto:privacy@assolabfondi.it\">privacy@assolabfondi.it</a>.</p></section></main><style>* { box-sizing: border-box; } body {margin: 0;}.text-white.text-center.py-4{background-color:#f08046;}#ih4ch{color:#f08046;}#isyy6{color:#f08046;}#irxri{color:#f08046;}#ixf6d{color:#f08046;}#iw4cm{color:#f08046;}#i5gea{color:#f08046;}#i7x0w{color:#f08046;}</style>', '2024-11-29 22:43:35', '2024-11-29 22:53:50'),
(76, 'term-service', '<br/><br/><br/><header class=\"bg-primary text-white text-center py-4\"><h1>Termini di Servizio</h1><p class=\"mb-0\">Leggi attentamente i termini prima di utilizzare la piattaforma AssoLabFondi</p></header><!-- Main Content --><main class=\"container my-5\"><section class=\"mb-5\"><h2 class=\"text-primary\">1. Accettazione dei Termini</h2><p>Utilizzando il sito web AssoLabFondi, accetti di rispettare i termini e le condizioni stabiliti in questa pagina. Se non accetti questi termini, ti invitiamo a non utilizzare il sito.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">2. Servizi Offerti</h2><p>AssoLabFondi offre servizi informativi, formativi e operativi per fondi pensione, casse di previdenza e fondi sanitari. Tutti i servizi sono soggetti a modifiche senza preavviso.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">3. Registrazione Utente</h2><p>Per accedere a determinati servizi, potrebbe essere necessario creare un account. Sei responsabile di mantenere la riservatezza delle credenziali e accetti di notificare immediatamente qualsiasi uso non autorizzato del tuo account.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">4. Contenuti Generati dagli Utenti</h2><p>Gli utenti possono pubblicare contenuti, commenti o partecipare a discussioni. Tuttavia, non sono consentiti contenuti illegali, offensivi o che violino diritti di terze parti. Ci riserviamo il diritto di rimuovere tali contenuti senza preavviso.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">5. Proprietà Intellettuale</h2><p>Tutti i contenuti del sito, inclusi testi, immagini, loghi e design, sono protetti da copyright e altre leggi sulla proprietà intellettuale. Non è consentito l\'uso non autorizzato di tali materiali.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">6. Limitazione di Responsabilità</h2><p>AssoLabFondi non sarà responsabile per eventuali danni diretti, indiretti o conseguenti derivanti dall\'uso o dall\'impossibilità di utilizzare i servizi forniti.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">7. Modifiche ai Termini</h2><p>Ci riserviamo il diritto di aggiornare i termini di servizio in qualsiasi momento. Ti invitiamo a controllare questa pagina periodicamente per verificare eventuali modifiche.</p></section><section class=\"mb-5\"><h2 class=\"text-primary\">8. Contatti</h2><p>Per domande sui termini di servizio, puoi contattarci via email a: <a href=\"mailto:info@assolabfondi.it\">info@assolabfondi.it</a>.</p></section></main><style>* { box-sizing: border-box; } body {margin: 0;}</style>', '2024-11-29 22:56:43', '2024-11-29 22:56:43');
